import '../App.css';
import React, { useState } from 'react';

const WeatherApi = ({apiData}) => {

    //const {ApiData} = onApiData;
    const {city, country, temp, iconImageURL, description} = apiData;
    console.log(apiData);
    console.log(city);
    console.log(iconImageURL);

    return ( 
        <div className='weatherApiBoxS'>
            <table>
                <tr style='height: 10px'>
                    <td rowSpan='2' style='width: 25px'> 
                        <img src={iconImageURL} alt='WeatherIcon'></img>
                    </td>
                    <th>
                        {city}
                    </th>
                </tr>
                <tr style='height: 20px'>
                    <td>
                        {temp} &#8451
                    </td>
                </tr>
            </table>
            
            <p>{city} weather is {description} and Temperature is </p>
        </div>
     );
}
 
export default WeatherApi;
